import Navbar from './Navbar';
import Link from 'next/link'

const Layout = (props) => (

    <div className="body">
        <Head>
            <title>IMDB</title>
        </Head>
        <Navbar />
        <div className="container">
            {props.children}
        </div>
    </div>

);

export default Layout;
